import {
  Accordion,
  AccordionDetails,
  AccordionSummary,
  Typography,
} from "@material-ui/core";
import "./Flight.css";

import { useState } from "react";
import { Modal, Button } from "antd";
import ModalFlight from "./ModalFlight";

const dataSource = [
  {
    key: '1',
    name: '',
    age: 32,
    address: '10 Downing Street',
  },
  {
    key: '2',
    name: 'John',
    age: 42,
    address: '10 Downing Street',
  },
];

const columns = [
  {
    title: 'Name',
    dataIndex: 'name',
    key: 'name',
  },
  {
    title: 'Age',
    dataIndex: 'age',
    key: 'age',
  },
  {
    title: 'Address',
    dataIndex: 'address',
    key: 'address',
  },
];

function Flight() {
 
  return (
    <div className="wrapper">
      <h5>Kết quả tìm kiếm</h5>
    </div>
  );
}

export default Flight;
